import React from "react";
import { connect } from "react-redux";
import { useDispatch } from "react-redux";
import { filterCards, mostrarTodos } from "../Redux/action";
import { orderCards} from "../Redux/action";
import styled from "styled-components";
import axios from "axios";
import { useEffect } from "react";
import { render } from "react-dom";

const Contain = styled.div `
 display:flex;
 flex-wrap: wrap;
 flex-direction: column;
 padding: 5px;
 `
const FavStyled = styled.div `
display:flex;
 flex-wrap: wrap;
 flex-direction: row;

 `
 const Cont = styled.div`
 position: relative;
 left: 20%;
 
 width: 85%;
 color: white;
 font-size: 25;
 
 `
 const Cont1 = styled.div`
 width:50%;
 `
const Cont2 = styled.div`
width: 50%;
`

export function Favorites(props) {
    props.myFavorites
    const dispatch = useDispatch();
    const favs = []
    const allChar = props.allCharacters[0];
    const promises = [];
    let final = []

    const renderizar = async() => {
        favs.push(...props.myFavorites) 
        console.log("FAvs",favs)
        for (let i = 0; i < favs[0].length; i++){
          promises.push(axios(`http://localhost:3001/all/dbdata/${favs[0][i].characterId}`))
            console.log("i", i)}
          const results = await Promise.all(promises);
          let requests = [];
          results.forEach((result) => {
            requests.push(result.data);

          });
        
            final = requests.forEach((result) => {
            let indCharacter = {};
            indCharacter.id = result.id;
            indCharacter.name = result.name;
            indCharacter.species = result.species;
            indCharacter.status = result.status;
            indCharacter.origin = result.origin;
            indCharacter.gender = result.gender;
            indCharacter.image = result.image;
            final.push(indCharacter)
          }) 
    }

    
    function ordenar  (e)  {
        const copia = [...favs] // este lo vas a tener que cambiar para el array favs del back o pedirle un personaje especifico solo con el ID. 
        if (e.target.value === "Ascendente" ) {
           
            let ascend = copia.sort((a, b) => a.id - b.id);
            dispatch(orderCards(ascend))
        
        }   
       if (e.target.value === "Descendente") {
            let descend = copia.sort((a,b) =>  b.id- a.id )
            dispatch(orderCards(descend))
        }
    }
     function filtrar   (e)  {
        if (e.target.value === "Todos") {
            dispatch(mostrarTodos())

        }
    else dispatch(filterCards(e.target.value))
     }

     useEffect(() => {
        renderizar();
     }, [props.myFavorites]);
     console.log("=====>" ,final)
    let funciona = [{id : 1,name:"ricko"}]

    return (
        <Cont>
        <div>
            <div>
            <select onChange= {ordenar}>
                <option value="Ascendente" >Ascendente</option>
                <option value="Descendente" >Descendente</option>
            </select>
            <select onChange = {filtrar}>
                <option value="Todos">Todos</option>
                <option value="Male" >Masculino</option>
                <option value="Female" >Femenino</option>
                <option value="Genderless" >Sin genero</option>
                <option value="Unknown" >Desconocido</option>
            </select>
            </div>
         <div style={{ border: '1px solid black', padding: '10px' }}>
            {final.map((t,i) => (
                <div key={i} style={{ border: '1px solid black', padding: '10px' }}>  
                <div>
                    <h2>{t.name}</h2> 
                    <h3>Especie: {t.species}</h3>
                    <h3>Genero: {t.gender}</h3>
                </div>
                <div>
                <img  src={t.image} alt={t.name} />   
                </div>
              
                </div>
            ))} 
        </div>       
   </div>
   </Cont>


    )   




}

export function mapStateToProps(state) {
    return {
       myFavorites : state.myFavorites,
       allCharacters: state.allCharacters
    }
 }
 export default connect(mapStateToProps, null)(Favorites);
